@Test
  public void testXor() {
    byte[] arr1 = { (byte) 0x00, (byte) 0x02, (byte) 0xFF };
    byte[] arr2 = { (byte) 0xF0, (byte) 0x02, (byte) 0xF0 };
    ByteArrayHelper.xor(arr1, arr2);
    assertEquals((byte) 0xF0, arr1[0]);
    assertEquals((byte) 0x00, arr1[1]);
    assertEquals((byte) 0x0F, arr1[2]);
  }

